import React from 'react';
import Upload from '../components/Upload';

export default function Dashboard() {
  const soccerBallStyle = {
    width: '80px',
    height: '80px',
    borderRadius: '50%',
    background: 'linear-gradient(45deg, #000 25%, transparent 25%), linear-gradient(-45deg, #000 25%, transparent 25%), linear-gradient(45deg, transparent 75%, #000 75%), linear-gradient(-45deg, transparent 75%, #000 75%)',
    backgroundSize: '25px 25px',
    backgroundPosition: '0 0, 0 12px, 12px -12px, -12px 0px',
    backgroundColor: '#fff',
    border: '4px solid #000',
    margin: '0 auto 25px auto',
    display: 'block',
    boxShadow: '0 4px 15px rgba(0,0,0,0.2)'
  };

  return (
    <div style={{ 
      minHeight: '100vh',
      background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
      padding: '30px'
    }}>
      <div style={{ 
        maxWidth: '900px', 
        margin: '0 auto'
      }}>
        <div style={{
          backgroundColor: 'white',
          padding: '50px',
          borderRadius: '30px',
          boxShadow: '0 20px 60px rgba(0,0,0,0.1)',
          border: '3px solid #fff'
        }}>
          <div style={soccerBallStyle}></div>
          <h1 style={{ 
            textAlign: 'center', 
            marginBottom: '15px', 
            color: '#333',
            fontSize: '32px',
            fontWeight: 'bold'
          }}>Football Coach AI</h1>
          <p style={{
            textAlign: 'center',
            color: '#666',
            fontSize: '18px',
            marginBottom: '40px'
          }}>Upload your football videos for AI-powered analysis</p>
          <Upload />
        </div>
      </div>
    </div>
  );
}
